import React from "react";
import { NavLink } from "react-router-dom";

const RouteButton = () => {
    return(
        <>
            <ul>
                <li>
                    <NavLink to='/'>Home</NavLink>
                </li>
            </ul>
        </>
    )
};

export default RouteButton;
